import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Tela from "../components/Tela.css"
import horas from "../components/imagens/horas.svg"
import Button from "react-bootstrap/esm/Button";
import Duvida from "../components/imagens/duvida.svg"
import Logo from "../components/imagens/quest_logo.png"
import Form1 from "../components/Cadastro/Form1";

export default function Body_config() {
  return (
    <div className="bg-light">
      <Container className="mb-4 px-4">
        <Form1/>
      </Container>
    </div>
  );
}
